import React from "react";

function Accounts({ accounts }) {
  return (
    <div className="card">
      {accounts.map((acc) => {
        <div key={acc.id}>
          {acc.name} - {acc.food_trusk.length}
        </div>;
      })}
    </div>
  );
}

export default Accounts;
